import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { Button } from './Button';

export default function BasicSelect() {
  const [click, setClick] = React.useState(false);
  const [button, setButton] = React.useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);

  const [order, setOrder] = React.useState('');
  const orderChange = (event) => {
    setOrder(event.target.value);
  };
  const [suborder, setsubOrder] = React.useState('');
  const subOrderChange = (event) => {
    setsubOrder(event.target.value);
  };
  const [genus, setGenus] = React.useState('');
  const GenusChange = (event) => {
    setGenus(event.target.value);
  };
  const [subgenus, setsubGenus] = React.useState('');
  const subGenusChange = (event) => {
    setsubGenus(event.target.value);
  };
  const [family, setFamily] = React.useState('');
  const FamilyChange = (event) => {
    setFamily(event.target.value);
  };
  const [subfamily, setsubFamily] = React.useState('');
  const subFamilyChange = (event) => {
    setsubFamily(event.target.value);
  };
  const [species, setSpecies] = React.useState('');
  const SpeciesChange = (event) => {
    setSpecies(event.target.value);
  };
  const [subspecies, setsubSpecies] = React.useState('');
  const subSpeciesChange = (event) => {
    setsubSpecies(event.target.value);
  };

  return (
    <Box sx={{m:1, border: 1, borderColor: 'green', width:130}}>
      {button && <Button buttonStyle='btn--outline'>SEARCH</Button>}
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">Order</InputLabel>
        <Select
          labelId="order-label"
          id="order-select"
          value={order}
          label="Order"
          onChange={orderChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Four</MenuItem>
          <MenuItem value={30}>Quad</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-label">SubOrder</InputLabel>
        <Select
          labelId="suborder-label"
          id="suborder-select"
          value={suborder}
          label="subOrder"
          onChange={subOrderChange}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-label">Genus</InputLabel>
        <Select
          labelId="genus-label"
          id="genus-select"
          value={genus}
          label="Genus"
          onChange={GenusChange}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-label">SubGenus</InputLabel>
        <Select
          labelId="subgenus-label"
          id="subgenus-select"
          value={subgenus}
          label="subGenus"
          onChange={subGenusChange}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-label">Family</InputLabel>
        <Select
          labelId="family-label"
          id="family-select"
          value={family}
          label="family"
          onChange={FamilyChange}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-label">SubFamily</InputLabel>
        <Select
          labelId="subfamily-label"
          id="subfamily-select"
          value={subfamily}
          label="subfamily"
          onChange={subFamilyChange}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">Species</InputLabel>
        <Select
          labelId="species-label"
          id="species-select"
          value={species}
          label="Species"
          onChange={SpeciesChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Four</MenuItem>
          <MenuItem value={30}>Quad</MenuItem>
        </Select>
      </FormControl>
      <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">SubSpecies</InputLabel>
        <Select
          labelId="subspecies-label"
          id="subspecies-select"
          value={subspecies}
          label="Species"
          onChange={subSpeciesChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Four</MenuItem>
          <MenuItem value={30}>Quad</MenuItem>
        </Select>
      </FormControl>
    </Box>
  );
}
